import React from "react";
import "./SignInModal.css";
import { useHref, useNavigate } from "react-router-dom";

function SignInModal() {
  const navigate = useNavigate();
  return (
    <div className="modal-parent">
      <div className="custom-modal p-2 d-flex flex-column ">
        <div className="custom-header d-flex justify-content-between">
        <i class="fa-solid fa-lock mx-2 mt-2"></i>
        <button onClick={()=>{useHref('/')}} className="btn-close mx-2"></button>
        </div>
        <div className="mt-3 d-flex justify-content-center">
            <button className="btn-get-started">Continue</button>
        </div>
      </div>
    </div>
  );
}

export default SignInModal;
